import React from "react";
import { Link } from "react-router-dom";


export default function Navbar() {
  return (
    <nav className="fixed top-0 left-0 w-full bg-white dark:bg-gray-900 shadow z-50">
      <div className="max-w-6xl mx-auto px-4 py-3 flex justify-between items-center">
        <h1 className="text-lg font-bold text-purple-700 dark:text-purple-300">Nigashini</h1>
        <ul className="flex space-x-4 text-sm font-medium">
          <li><a href="#hero" className="hover:text-purple-500 dark:hover:text-purple-300">Home</a></li>
          <li><a href="#about" className="hover:text-purple-500 dark:hover:text-purple-300">About</a></li>
          <li><a href="#skills" className="hover:text-purple-500 dark:hover:text-purple-300">Skills</a></li>
          <li><a href="#projects" className="hover:text-purple-500 dark:hover:text-purple-300">Projects</a></li>
          <li><a href="#certifications" className="hover:text-purple-500 dark:hover:text-purple-300">Certifications</a></li>
          <li><a href="#contact" className="hover:text-purple-500 dark:hover:text-purple-300">Contact</a></li>
        </ul>
      </div>
    </nav>
  );
}
